import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import HeroSection from './components/HeroSection';
import ServicesSection from './components/ServicesSection';
import AboutUsSection from './components/AboutUsSection';
import VeteransSection from './components/VeteransSection';
import ContactSection from './components/ContactSection';
import Footer from './components/Footer';
import './index.css'; // Assuming Tailwind CSS is imported here

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <main>
          <Routes>
            {/* In React Router v6, "exact" is no longer needed and each Route should use an "element" prop */}
            <Route path="/" element={
              <>
                <HeroSection />
                <ServicesSection />
                <AboutUsSection />
                <VeteransSection />
                <ContactSection />
              </>
            } />
            {/* Define other routes if your application has multiple pages */}
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
